import React from 'react'
import Card from '../components/Card'
import { useProductsContext } from '../hooks/useProductsContext'

const Profile = () => {
 
  const {productsData} = useProductsContext()
  const productsDataLocal=productsData.slice(0,5)
  return (
    <div className='profile--main'>
      <div className='profile--sidebar'>
        <img src='..\images\Product_1_Wukong.webp' className='profile--picture' />
        <h1>User Name</h1>
        <h2>Description</h2>
        <p>Member since 2020</p>
        <p>Rating: 5.0 (20)</p>
      </div>
      <div className='profile--main--right'>

        <p>This is your profile and your merchs</p>
        <h2>This is a list of your merchs.</h2>
        <p>sort by: date, count</p>
        <div className='card-container'>
          {productsDataLocal.map((i) => {
            return <Card img={i.img} name={i.name} />
          })}
        </div>
      </div>

    </div>
  )
}

export default Profile
